package ao.jobera.com.e_diaristas.core.models;import ao.jobera.com.e_diaristas.core.models.enums.TipoUsuario;import jakarta.persistence.*;import lombok.*;@Entity@Data@NoArgsConstructor@AllArgsConstructor@EqualsAndHashCode(onlyExplicitlyIncluded = true)@ToString(onlyExplicitlyIncluded = true)public class Usuario {    @EqualsAndHashCode.Include    @ToString.Include    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private long id;    @Column(name = "nome_completo", nullable = false)    private String nomeCompleto;    @Column(nullable = false, unique = true)    private String email;    @Column(nullable = false)    private String senha;    @Column(name = "tipo_usuario", nullable = false, length = 7)    @Enumerated(EnumType.STRING)    private TipoUsuario tipoUsuario;}